import React,{Component} from 'react'; 
import Afternav from "../Coponent/nav_after";

class Profile extends Component {
    constructor(){
        super();
        this.state = {
            l:[]
        }
    }
    handleSubmit1= (event) =>{
        const d=this.props.user
        console.log(d)
        this.setState({
            l:d
        })
    }
    
    render() {
        const {l}=this.state
        
        return (
            <div className="room">
                <Afternav />   
                <div className="allPro">      
                <button onClick={()=>this.handleSubmit1()}>Your profile</button>  
                <div>{  
                    l.email
                    }
                </div>              
                    <div className="containerPro">
                        <div className="colPro1">
                            <img src="https://m.foolcdn.com/media/affiliates/images/add_authorized_user_EkoeHmZ.width-793.jpg?width=793" alt="avaotr"></img>
                            <input type="file"/>
                            <button>Upload</button>
                        </div>
                        <div className="clear"></div>
                        <div className="colPro2">
                            <ul>
                                <li>
                                    <p>First Name: </p> 
                                    <h2>{l.first_name}</h2>
                                </li> 
                            
                                <li>
                                    <p>Last Name: </p>
                                    <h2>{l.last_name}</h2>
                                </li>                       
                            
                                <li>
                                    <p>Email: </p>
                                    <h2>{l.email}</h2>
                                </li>                          
                                <li>
                                    <p>Mobile Phone: </p>
                                    <h2>{l.mobile_phone}</h2>
                                </li>         
                                <button className="save_button" onClick={()=>this.handleSubmit1()}>save</button>              
                            </ul>                      
                                
                        </div>
                    </div>
                </div>
            </div>
            );
    }
}
export default Profile;
